reviewContent:
해바라기,부엉이 두개2주정도 걸렸어요~ 
첨엔 잼있다가 점점 눈도아프고 목어깨아프고힘들어지는데완성해놓으면 진짜예뻐요~ 
예뻐서 또 하고싶긴한데 사이즈더작으면서 이쁜게있었음좋겠어요~ 접찹력 붙일땐 완전좋아서 절때안떨어지겠다했는데  완성하고 몇일지나니까 비즈가 떨어질려고살짝 일어나는게 몇개보여요ㅠ 다하고 무거운 책으로 덮어눌러주란말이있었던거같은데  그렇게해야 좋을거 같아요~~ 해바라기 할땐 비즈불량1도없었고 비즈여유분많아서 남았는데 부엉이할때 한가지색비즈만 불량많았어요ㅠ비즈자기들끼리붙어있는게많아서 불량 빼고하면 부족할뻔했어요ㅜ겨우딱맞게했어요 다행~~;;

심심하던찰나에 취미를 찾던중 비즈공예관련 콘테츠중이 재료도 다 들어있고 도전하기 쉬울것같아서
다해놓고 걸어두면 이쁜그림으로 선택햇어요
배송도 하루만에 다하고 또 사러올게요 &gt;.&lt;

주문한거 잘 맞게 왔어요~
한번에 너무 많이 주문했는데 나중에 불량품 나오면 어쩌나 걱정이 되긴 하네요^^;;;;
완성품이 생각보다 이뻐서 여기서 계속 사요~

태교 겸 부모님 선물로 드렸는데
이런 선물 처음받아본다며 신기해하고 좋아하셨어요
졸지에 다른 작품들도 해달라고 주문받았네요;;

시골집에 인테리어용으로 장식할려고 샀어요!~
한번 품절이었어서 3주정도 기다렸다가 구매했는데 너무 맘에 들어요!!~
한두달 쉬다가 드디어 완성!! 너무너무 예뻐요 시골별장에 갖다놨어요 ㅎㅎ 넘나 반짝반짝합니다&hearts;

비즈도 넘 반짝이고 색감도 넘 이뻐요^^
간혹 불량비즈가 있어서 붙일때 잘보셔야할듯^^;;
집순이인 저에게 딱좋은 취미생활이 생겼습니다^^
